DROP TABLE IF EXISTS `framework_users`;
CREATE TABLE `framework_users` (
  `USR_ID` int(11) NOT NULL AUTO_INCREMENT,
  `USR_CODE` varchar(20) DEFAULT NULL,
  `USR_FIRSTNAME` varchar(50) DEFAULT NULL,
  `USR_OTHERNAME` varchar(100) DEFAULT NULL,
  `USR_GENDER` varchar(10) DEFAULT NULL,
  `USR_COUNTRY` varchar(100) DEFAULT NULL,
  `USR_USERNAME` varchar(20) NOT NULL,
  `USR_PASSWORD` varchar(255) NOT NULL,
  `USR_EMAIL` varchar(100) NOT NULL,
  `USR_LOGIN_STATUS` enum('0','1','2','3') DEFAULT '1',
  `USR_LASTLOGIN_DATE` datetime DEFAULT NULL,
  `USR_STATUS` enum('1','0') NOT NULL DEFAULT '1' COMMENT '0 IS INACTIVE, 1IS ACTIVE',
  `USR_BRANCH_CODE` varchar(255) DEFAULT NULL,
  `USR_COMPANY_CODE` varchar(255) DEFAULT NULL,
  `USR_ACCESS_LEVEL` enum('1','2','3','4') DEFAULT '1' COMMENT '1 IS ',
  `USR_PHOTO` varchar(255) DEFAULT NULL,
  `USR_APIKEY` varchar(255) DEFAULT NULL,
  `USR_DATE_ADDED` datetime DEFAULT NULL,
  `USR_ACTOR_ID` varchar(50) DEFAULT NULL,
  `USR_ABOUT_USER` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`USR_ID`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

